import React from 'react'

const GptSearchBar = () => {
  return (
    <div className='pt[20%]'> 
        <form className='p-2 m-4 bg-black'>
            <input type='text' placeholder='What would you like to watch Today?'></input>
            <button className='py-2 px-4 bg-red-800 text-white'> Search</button>
        </form>
      
    </div>
  )
}

export default GptSearchBar
